import React,{useEffect,useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});



export default function Data() {
    const classes = useStyles();
    const [persons,setPersons]= useState([])
   
    useEffect(() => {
        fetch("https://gorest.co.in/public/v1/users", {
            headers: {
                "Content-Type": "application/json",
                "Authorization": "Bearer bc1e0809f9bb5ce03125ea49290ec9c8acc225870ebd21e484217e79b88800db"
            } })
        .then(resp => resp.json())
        .then(data => setPersons(data))
    
    }, [persons]);
console.log(persons)
  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Id</TableCell>
            <TableCell align="right">Name</TableCell>
            <TableCell align="right">Email</TableCell>
            <TableCell align="right">Gender</TableCell>
            <TableCell align="right">Status</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {persons.map((person) => (
            <TableRow key={person.id}>
              <TableCell component="th" scope="row">
                {person.id}
              </TableCell>
              <TableCell align="right">{person.name}</TableCell>
              <TableCell align="right">{person.email}</TableCell>
              <TableCell align="right">{person.gender}</TableCell>
              <TableCell align="right">{person.status}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
